import React from 'react'
import {BrowserRouter, Route, Link} from "react-router-dom";



class ManagerNav extends React.Component {
    render() {
        return (
            <BrowserRouter>
                <div>
                    <nav className=" left fixed vertical menu">
                        <div className="item">

                            <Link to="/manager" className="item" style={{fontSize:"20px"}}>manager</Link>
                            <Link to="/hr" className="item" style={{fontSize:"20px"}}>HR</Link>
                            <Link to="/manager" className="item"style={{fontSize:"20px"}}>feedback</Link>
                            <Link to="/hr" className="item" style={{fontSize:"20px"}}>goal</Link>

                        </div>
                    </nav>



                </div>

            </BrowserRouter>
        )
    }
}
export default  ManagerNav
